typedef unsigned long long ull;
struct FastMod {
    ull b, m;

    FastMod(ull b) : b(b), m(-1ULL / b) {}

    ull reduce(ull a) { // a % b + (0 or b)
        return a - (ull) ((__uint128_t(m) * a) >> 64) * b;
    }
};

ll mul(ll a, ll b){
    return ((a%MOD)*(b%MOD))%MOD;
}

ll powmod(ll a, ll b){
    if(b == 0) return 1;
    ll temp = powmod(a, b/2);
    if(b%2) return mul(a, mul(temp, temp));
    else return mul(temp, temp);
}

void work() {
    ll n;
    cin >> n;
    assert(n > 1 && n <= 1e18);
    ull ans = 1;
    if ( n >= MOD ) {
        cout << 0 << endl;
        return;
    }
    ll q = n*n;
    if ( q >= MOD ) {
        cout << 0 << endl;
        return;
    }
    if ( n >= 15000 ) {
        cout << prec[n-15000] << endl;
        return;
    }
    FastMod fm(MOD);
    for ( ll i = 1 ; i <= q ; i++ ) {
        ans = fm.reduce(ans * i);
    }
    ull inv = powmod(2, MOD-2);
    ans %= MOD;
    ans *= inv;
    ans %= MOD;
    cout << ans << endl;
}


int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    ll t = 1;
//    cin >> t;
    while ( t-- ) work();
    return 0;
}